import React from 'react';
import { Box, Grid } from '@mui/material';
import Base from '../components/Base';
import TableComponent from '../components/Table';

function Historic() {
  const rows = [
    {
      id: 1,
      date: "01/12/23",
      description: "Supermecado Dona Novinha",
      total: 234.0,
      items: [{ nome: "test", qtd: 2, value: 12, total: 24 }],
      view: true
    },
  ];
  const header = ["Data", "Descrição", "Total", "Item"];
  return (
    <Base title="Historico de Compras">
      <Box sx={{ flexGrow: 1 }}>
        <Grid container spacing={2} mt={2}>
          <Grid item lg={12}>
            <TableComponent rows={rows} header={header} />
          </Grid>
        </Grid>
      </Box>
    </Base>
  )
}

export default Historic;
